import React, { Fragment } from "react";
import { useHistory } from "react-router-dom";

const AdminNavber = (props) => {
  const history = useHistory();

  const logout = () => {
    localStorage.removeItem("jwt");
    localStorage.removeItem("cart");
    localStorage.removeItem("wishList");
    window.location.href = "/";
  };

  return (
    <Fragment>
      <nav className="sticky z-10 flex items-center shadow-md justify-between px-4 py-4 md:px-8 top-0 w-full bg-white">
        {/*  Large Screen Show  */}
        {/*  End Large Screen Show  */}

        {/*  Large Screen Show  */}
        <div className="hidden lg:block">
          <span
            onClick={(e) => history.push("/admin/dashboard")}
            style={{ letterSpacing: "0.70rem" }}
            className="flex items-left text-center font-bold uppercase text-gray-800 text-2xl cursor-pointer px-2 text-center"
          >
            Shop Point
          </span>
        </div>
        {/*  End Large Screen Show  */}

        {/* Small Screen Show */}
        {/* End Small Screen Show */}

        {/* Both Screen show */}
        {/* End Both Screen show */}

        <div className="flex items-center">
          {/* Search Icon */}
          {/* End Search Icon */}

          {/* Cart Icon */}
          {/* End Cart Icon */}

          {/* Logout Button Dropdown */}
          <div
            className="userDropdownBtn hover:bg-gray-200 px-2 py-2 rounded-lg relative"
            title="Logout"
          >
            {/* Logout Icon */}
            {/* End Logout Icon */}

            <div className="userDropdown absolute right-0 mt-1 bg-gray-200 rounded">
              <ul className="flex flex-col text-gray-700">
                {/* Shop Option */}
                <li
                  onClick={(e) => history.push("/")}
                  className="flex space-x-1 py-2 px-8 hover:bg-gray-400 cursor-pointer"
                >
                  {/* Shop Icon */}
                  {/* End Shop Icon */}
                  <span>Shop</span>
                </li>
                {/* End Shop Option */}

                {/* Setting Option */}
                <li className="flex space-x-1 py-2 px-8 hover:bg-gray-400 cursor-pointer">
                  {/* Setting Icon */}
                  {/* End Setting Icon */}
                  <span>Setting</span>
                </li>
                {/* End Setting Option */}

                {/* Logout Option */}
                <li
                  onClick={(e) => logout()}
                  className="flex space-x-1 py-2 px-8 hover:bg-gray-400 cursor-pointer"
                >
                  {/* Logout Icon */}
                  {/* End Logout Icon */}
                  <span>Logout</span>
                </li>
                {/* End Logout Option */}
              </ul>
            </div>
          </div>
        </div>
        {/* End Logout Button Dropdown */}
      </nav>
    </Fragment>
  );
};

export default AdminNavber;
